<template>
  <section class="py-4 md:bg-grey-lighter md:py-20">
    <div class="w-full md:max-w-md lg:max-w-lg xl:max-w-2xl mx-auto">
      <div class="w-full md:rounded md:rounded-lg overflow-hidden md:shadow-lg bg-white md:mb-10">
        <div class="relative">
          <img
            class="w-full"
            src="data:image/jpeg;base64,"
          >
          <div class="w-24 block mx-auto -mt-8 rounded rounded-full border-4 border-white md:absolute md:pin-l pin-b -mb-8 md:ml-4">
            <img :src="user.avatar">
          </div>
        </div>

        <div class="w-full flex flex-wrap px-6 py-8 text-center md:text-left">
          <div class="w-full md:w-1/2">
            <h2>{{ user.name }}</h2>
            <div class="text-grey">
              <p class="pt-2">@{{ user.username }}</p>
            </div>
          </div>
          <div class="w-full md:w-1/2">
            <button class="md:float-right mt-4 md:m-0 bg-teal hover:bg-teal-light text-white font-bold py-2 px-4 border-b-4 border-teal-dark hover:border-teal rounded" @click="follow">
              <span class="text-sm">{{ user.followers | followersFormat }}</span> <span class="font-bold">Follow</span>
            </button>
          </div>
        </div>
      </div>
    </div>
  </section>
</template>
<script>
import { mapState } from 'vuex'
export default {
  middleware: 'user',
  computed: {
    ...mapState({
      user: 'user'
    })
  },
  methods: {
    follow(e) {
      e.preventDefault()
      this.$swal.fire({
        title: 'Login Required',
        type: 'warning',
        showConfirmButton: false,
        html:
          '<p>To follow this user, you must signin with your account, or signup if you are new user</p><p class="text-center mt-2 mb-4"><a class="p-4" href="/signin">Signin</a> <a class="p-4" href="/signup">Signup</a></p>'
      })
    }
  }
}
</script>
